	var montarGrafico = function(){
		

	
		Highcharts.chart('container', {

			title: {
				text: 'Histórico de acertos'
			},

			yAxis: {
				title: {
					text: '%'
				}
			},

			xAxis: {
				accessibility: {
					rangeDescription: 'Últimos dias'
				}
			},

			legend: {
				layout: 'vertical',
				align: 'right',
				verticalAlign: 'middle'
			},

			xAxis: {
				categories: ['últimos 30 dias', 'últimos 14 dias', 'últimos 7', 'ontem dias']
			},
			
			plotOptions: {
				series: {
					label: {
						connectorAllowed: false
					}
				}
			},

			series: [{
				name: 'Acertos',
				data: [($scope.historico.details.last_30_days.won/$scope.historico.details.last_30_days.total)*100, ($scope.historico.details.last_14_days.won/$scope.historico.details.last_14_days.total)*100, ($scope.historico.details.last_7_days.won/$scope.historico.details.last_7_days.total) * 100, ($scope.historico.details.yesterday.won/$scope.historico.details.yesterday.total)*100]
			}, {
				name: 'Derrota',
				data: [($scope.historico.details.last_30_days.lost/$scope.historico.details.last_30_days.total)*100, ($scope.historico.details.last_14_days.lost/$scope.historico.details.last_14_days.total)*100, ($scope.historico.details.last_7_days.lost/$scope.historico.details.last_7_days.total) * 100, ($scope.historico.details.yesterday.lost/$scope.historico.details.yesterday.total) * 100]
			}],

			responsive: {
				rules: [{
					condition: {
						maxWidth: 500
					},
					chartOptions: {
						legend: {
							layout: 'horizontal',
							align: 'center',
							verticalAlign: 'bottom'
						}
					}
				}]
			}

		});
	}

	var buscarHistorico = function(liga){
		$.ajax({
			url: "https://football-prediction-api.p.rapidapi.com/api/v2/performance-stats",
			headers: {"X-RapidAPI-Key": "c4aeeb9b8emshad20a56bd63200fp1bdd44jsn9d98c52bf204",
			params: {federation: liga},
			"X-RapidAPI-Key": "c4aeeb9b8emshad20a56bd63200fp1bdd44jsn9d98c52bf204"},
            success: function(data) { sucessoMudarLigaHistorico(data); }
      });
	}

	var sucessoMudarLigaHistorico = function(data){
		$scope.historico = data.data;
		montarGrafico();
	}
	
	var buscarLigas = function(){
		$.ajax({
			url: "https://football-prediction-api.p.rapidapi.com/api/v2/list-federations",
			headers: {"X-RapidAPI-Key": "c4aeeb9b8emshad20a56bd63200fp1bdd44jsn9d98c52bf204"},
            success: function(data) { sucessoLigas(data); }
      });
	}
	
	var sucessoLigas = function(data){
		$scope.ligas = data.data;
		
	}
	
	
	var buscarPredicoes = function(liga){
		$.ajax({
			url: "https://football-prediction-api.p.rapidapi.com/api/v2/predictions",
			headers: {"X-RapidAPI-Key": "c4aeeb9b8emshad20a56bd63200fp1bdd44jsn9d98c52bf204",
			params: {federation: liga},
			"X-RapidAPI-Key": "c4aeeb9b8emshad20a56bd63200fp1bdd44jsn9d98c52bf204"},
            success: function(data) { sucessoPredicoes(data); }
      });
	}
	
	var buscarPredicao = function(id){
		$.ajax({
			url: "https://football-prediction-api.p.rapidapi.com/api/v2/predictions/" + id,
			headers: {"X-RapidAPI-Key": "c4aeeb9b8emshad20a56bd63200fp1bdd44jsn9d98c52bf204",
			"X-RapidAPI-Key": "c4aeeb9b8emshad20a56bd63200fp1bdd44jsn9d98c52bf204"},
            success: function(data) { sucessoPredicao(data); }
      });
	}
	
	var sucessoPredicao = function(data){
		$scope.predicao = data.data
		console.log($scope.predicao);
	}
	
	var sucessoPredicoes = function(data){
		$scope.predicoesCompletas = data.data;
		$scope.filtrar();
	}
	
	$scope.filtrar = function(){
		angular.copy($scope.predicoesCompletas, $scope.predicoes);
		
		$scope.predicoes = jQuery.grep($scope.predicoes, function( n, i ) {
			return (
			(n.home_team.includes($scope.filtro.timeCasa) || $scope.filtro.timeCasa == null || $scope.filtro.timeCasa == "") && 
			(n.away_team.includes($scope.filtro.timeVisitante)  || $scope.filtro.timeVisitante == null || $scope.filtro.timeVisitante == "") && 
			(n.competition_cluster.includes($scope.filtro.pais) || $scope.filtro.pais == null || $scope.filtro.pais == "") && 
			(n.competition_name.includes($scope.filtro.competicao) || $scope.filtro.competicao == null || $scope.filtro.competicao == "")
			);
		});
		
		if($scope.predicoes.length > 15)
		$scope.predicoes.length = 15;
	}
	
	init();
